class Blog extends react.Component {

    render() {
        //const router = useRouter();

        return (
            <BaseLayout>
                <h1>{this.props.router.query.title}}</h1>
                <p>Hello!</p>
            </BaseLayout>
        )
    }
}

export default Blog;
